Dropzone.options.myDropzone={paramName:"file",url:"upload",addRemoveLinks:!0,autoProcessQueue:!1,uploadMultiple:!0,parallelUploads:5,maxFilesize:30,acceptedFiles:".png",dictDefaultMessage:"To add file click/add file here",init:function(){let e=this;document.getElementById("addImage").addEventListener("click",function(n){n.preventDefault(),n.stopPropagation(),e.processQueue()}),e.on("sending",function(e,n,o){let i=$("#my-Dropzone").serializeArray();$.each(i,function(e,n){o.append(n.name,n.value)})}),e.on("error",function(e){alert("There is some thing wrong, Please try again!")}),e.on("success",function(e,n){n.uploaded&&alert("File Uploaded: "+e.name)}),e.on("addedfile",function(n){n.previewElement.addEventListener("click",function(){e.removedfile(n)})}),e.on("maxfilesexceeded",function(n){e.removedfile})}};